import React, { Component } from "react";
import { BrowserRouter as Router, Route } from "react-router-dom";
import "./App.css";

import Home from "./pages/Index";
import About from "./pages/About";
import Articles from "./pages/Articles";
import Article from "./pages/Article";
import Navigation from "./Navbar";

import Games from "./pages/Games";

class App extends Component {
  constructor(props) {
    super(props);
    this.state = {
      games: [],
    };
  }
  componentDidMount() {
    fetch("https://xapi.us/v2/2533274831248967", {
      headers: {
        "X-Auth": "d0595f6a0c7715a3e29402123af886c7e4dd9889",
      },
    })
      .then((res) => res.json())
      .then((data) => {
        let games = data.res.map((score) => {
          return (
            <div key={score.titleId}>
              <p>{score.maxGamerscore}</p>
            </div>
          );
        });
        this.setState({ games: games });

        console.log("state", this.state.games);
      });
  }
  render() {
    return (
      // <Router>
      //   <div className="app">
      //     <Navigation />
      //     <Route path="/" component={Home} exact />
      //     <Route path="/about" component={About} />
      //     <Route path="/articles" component={Articles} />
      //     <Route path="/article" component={Article} />
      //     <Route path="/games" component={Games} exact />
      //   </div>
      // </Router>
      <div>
        <div>{this.state.games}</div>
      </div>
    );
  }
}

export default App;
